import React from 'react';
import Link from 'next/link';
const Hello = () => {
  console.log('****');
  return (
    <div>
      <Link href="/about">
        <button>About page</button>
      </Link>
      <Link href="/contact">
        <a>Contact page</a>
      </Link>
      <h1>Our Index Page</h1>
    </div>
  );
};

export default Hello;
